        con.Open();
        DataSet ds = new DataSet();

        SqlDataAdapter da = new SqlDataAdapter("SELECT poss_tgl FROM poss WHERE DATEPART(month, poss_tgl) = '" + blnOpen + "' AND DATEPART(year, poss_tgl) = '" + thnOpen + "'", con);
        da.Fill(ds);
        int count = ds.Tables[0].Rows.Count;
        if (count == 0)
        {
            if (blnOpen == "")
            {
                ClientScript.RegisterStartupScript(GetType(), "Message", "<SCRIPT LANGUAGE='javascript'>alert('Gagal ! Anda belum memilih bulan POSS yang akan dibuka !');</script>");
            }
            else if (thnOpen == "")
            {
                ClientScript.RegisterStartupScript(GetType(), "Message", "<SCRIPT LANGUAGE='javascript'>alert('Gagal ! Anda belum memilih tahun POSS yang akan dibuka !');</script>");
            }
            else
            {
                cmdAccord.ExecuteNonQuery();
                ClientScript.RegisterStartupScript(GetType(), "Message", "<SCRIPT LANGUAGE='javascript'>alert('Sukses ! Periode POSS berhasil dibuka, terimakasih !'); window.location.href='poss.aspx'</script>");
