        {
            ClientScript.RegisterStartupScript(GetType(), "Message", "<SCRIPT LANGUAGE='javascript'>alert('Gagal ! Periode POSS " + blnOpen + "/" + thnOpen + " sudah tersedia / sudah pernah di dibuka sebelumnya !');</script>");
        }

        con.Close();
    }

