    protected void btnPostingPoss_Click(object sender, EventArgs e)
    {
        string dataPosting = Request.QueryString["data"];
        string blnPosting = Request.QueryString["bulan"];
        string thnPosting = Request.QueryString["tahun"];
        string modelPosting = Request.QueryString["type"];
        string jumlahPosting = txtPostingJml.Text;

        string cs = System.Configuration.ConfigurationManager.ConnectionStrings["setiawanConnectionString1"].ConnectionString;
        SqlConnection con = new SqlConnection(cs);
        SqlCommand cmd = new SqlCommand("UPDATE poss SET " + dataPosting + " = '" + jumlahPosting + "' WHERE poss_model = '" + modelPosting + "' AND DATEPART(month, poss_tgl) = '" + blnPosting +"' AND DATEPART(year, poss_tgl) = '" + thnPosting + "'", con);
        con.Open();

        DataSet ds = new DataSet();
        SqlDataAdapter da = new SqlDataAdapter("SELECT poss_model FROM poss WHERE poss_model = '" + modelPosting + "' AND DATEPART(month, poss_tgl) = '" + blnPosting + "' AND DATEPART(year, poss_tgl) = '" + thnPosting + "'", con);
        da.Fill(ds);
        int count = ds.Tables[0].Rows.Count;
        if (count == 0)
        {
            ClientScript.RegisterStartupScript(GetType(), "Message", "<SCRIPT LANGUAGE='javascript'>alert('Gagal Posting ! Periode data POSS belum dibuka !');</script>");       
        }
        else
        {
            DataSet ds2 = new DataSet();
            SqlDataAdapter da2 = new SqlDataAdapter("SELECT poss_model FROM poss WHERE poss_lock = '0' AND poss_model = '" + modelPosting + "' AND DATEPART(month, poss_tgl) = '" + blnPosting + "' AND DATEPART(year, poss_tgl) = '" + thnPosting + "'", con);
            da2.Fill(ds2);
            int count2 = ds2.Tables[0].Rows.Count;
            if (count2 == 0)
            {
                ClientScript.RegisterStartupScript(GetType(), "Message", "<SCRIPT LANGUAGE='javascript'>alert('Gagal Posting ! Data periode yg anda maksud sudah tidak dapat diubah !');</script>");
            }
            else
            {
                cmd.ExecuteNonQuery();
                ClientScript.RegisterStartupScript(GetType(), "Message", "<SCRIPT LANGUAGE='javascript'>alert('Berhasil Posting !'); window.location.href='poss.aspx#"+ modelPosting +"';</script>");
            }
        }
        con.Close();
    }
